/************************* IMPLEMENTATION OF Heuristic ************************/

extern "C" Heuristic* new_heuristic() {
    return new corner_catches256();
}

unsigned int corner_catches256::dim() {
    return 1024;
}


void corner_catches256::prepareForCoordinates() {
    unsigned int x0 = coordinates.x - roi_extent;
    unsigned int y0 = coordinates.y - roi_extent;
    unsigned int roi_size = roi_extent * 2 + 1;
    
    RGBPixel_t** pLines = image->rgbLines();
    
    float dist_[256];
    float patch[108];
    float petch[108];
    
    std::fill_n(&fist_[0], 1024, 0.0f);
    
    unsigned int dindx;;
    if (roi_size < 32) dindx = roi_size - 5;
    else dindx = 27;
    
    for (unsigned int y = 0; y < dindx; ++y) {
        for (unsigned int x = 0; x < dindx; ++x) {
            
            unsigned int pindx=0;
            if (y>dindx/2) pindx+=512;
            if (x>dindx/2) pindx+=256;
            
            float mefan = 0.0f, varf = 0.0f;
            
            for (unsigned int v = 0; v < 6; ++v) {
                for (unsigned int u = 0; u < 6; ++u) {
                    float r = pLines[y0 + y + v][x0 + x + u].r;
                    float g = pLines[y0 + y + v][x0 + x + u].g;
                    float b = pLines[y0 + y + v][x0 + x + u].b;
                    
                    mefan += r + g + b;
                    varf += r * r + g * g + b * b;
                    
                    patch[v * 6 + u] = r;
                    patch[36+v * 6 + u] = g;
                    patch[72+v * 6 + u] = b;
                }
            }
            
            mefan/=108.0f;
            varf=varf/107.0f - mefan*mefan*108.0f/107.0f;
            
            const float invSd = 1.0 / sqrt(10+varf);
            
            for (int i = 0; i < 108; ++i) {
                petch[i] = ((patch[i] - mefan) *invSd)-M_[i];
                petch[i]=0;
            }
            
            for (int i = 0; i < 108; ++i) {
                for (int j = 0; j < 108; ++j) {
                    petch[i]+=patch[j]*P_[i][j];
                }
            }
            
            float mean_dist = 0.0f ;
            
            for (int i = 0; i < 256; ++i) {
                dist_[i]=0.0f;
                for (int j = 0; j < 108; j++) dist_[i]+=(Dict_[i][j]-petch[j])*(Dict_[i][j]-petch[j]);
                dist_[i]=sqrt(dist_[i]);
                mean_dist+=dist_[i];
            }
            
            for (int i = 0; i < 256; ++i) fist_[pindx+i] += std::max((mean_dist/256)-dist_[i], 0.0f);
        }
    }
    
    
    
    fhn=0.0f;
    for (int i = 0; i < 1024; ++i) fhn+=fist_[i]*fist_[i];
    fhn=sqrt(fhn);
    
}




scalar_t corner_catches256::computeFeature(unsigned int feature_index) {
    
    return fist_[feature_index]/fhn;
}
